    public List<LogNewPPMEventResponse> getLogNewPPMEvents(TransactionReceipt transactionReceipt) {
        List<EventValuesWithLog> valueList = extractEventParametersWithLog(LOGNEWPPM_EVENT, transactionReceipt);
        ArrayList<LogNewPPMEventResponse> responses = new ArrayList<LogNewPPMEventResponse>(valueList.size());
        for (EventValuesWithLog eventValues : valueList) {
            LogNewPPMEventResponse typedResponse = new LogNewPPMEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.id = (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.dp = (String) eventValues.getNonIndexedValues().get(1).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

    public Flowable<LogNewPPMEventResponse> logNewPPMEventFlowable(EthFilter filter) {
        return web3j.ethLogFlowable(filter).map(new io.reactivex.functions.Function<Log, LogNewPPMEventResponse>() {
            @Override
            public LogNewPPMEventResponse apply(Log log) {
                EventValuesWithLog eventValues = extractEventParametersWithLog(LOGNEWPPM_EVENT, log);
                LogNewPPMEventResponse typedResponse = new LogNewPPMEventResponse();
                typedResponse.log = log;
                typedResponse.id = (String) eventValues.getNonIndexedValues().get(0).getValue();
                typedResponse.dp = (String) eventValues.getNonIndexedValues().get(1).getValue();
                return typedResponse;
            }
        });
    }

